import axios from 'axios';


export const getAxios = (endPoint, data = {}, config = {}) =>
    axios({
        url: `http://172.16.251.79:8080/${endPoint}`,
        method: 'get',
        withCredentials: true,
        data: data,
        ...config,
    });

export const postAxios = (endPoint, params = {}, config = {}) =>
    axios({
        url: `http://172.16.251.79:8080/${endPoint}`,
        method: 'POST',
        withCredentials: true,
        data: params,
        ...config,
    });

export const deleteAxios = (endPoint) =>
    axios({
        url: `http://172.16.251.79:8080/${endPoint}`,
        method: 'DELETE',
        withCredentials: true,
    });


